import '../Styles/App.css';
import Footer from './Footer';
import Header from './Header';

function App() {
  return (
    <div className="App"> 
      <h1>Memory game</h1>
      <Header />
      <div>
            <div className="row">
                <div className="col"><button>3x3</button></div>
                <div className="col"><button>4x4</button></div>
                <div className="col"><button>5x5</button></div>
            </div>
        </div>
      <Footer />
    </div>
  );
}

export default App;
